import { Link } from "react-router-dom";

const EVENTS=[
    {id:"e1", title:"Event-1"},
    {id:"e2", title:"Event-2"},
    {id:"e3", title:"Event-3"},
];

export default function EventsPage(){
    return <>
        <h1>Events Page</h1>
        <main>
            <ul>
                {EVENTS.map((event)=>{
                    return <li key={event.id}>
                        <Link to={event.id}>{event.title}</Link>
                    </li>
                })}
            </ul>
        </main>
    </>
};
